import React from "react";
import { NavLink } from "react-router-dom";

const items = [
  {
    label: "Início",
    icon: "home",
  },
  {
    label: "Sobre Mim",
    icon: "user",
  },
  {
    label: "Serviços",
    icon: "cogs",
  },
];

const Navbar = () => {
  const itemList = items.map(({ label, icon }) => {
    return (
      <NavLink to="/" {...(label === "/" ? `exact` : null)}>
        <div className="item">
          <i className={`${icon} icon`}></i> {label}
        </div>
      </NavLink>
    );
  });
  return (
    <div className="ui secondary menu">
      <div className="right menu">{itemList};</div>
    </div>
  );
};

export default Navbar;
